    false,nt"url": null,nt"notes": "The Lower Souris Migratory Waterfowl Refuge
    (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
    of the Canadian border in North Dakota. The refuge was established and constructed
    by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
    events taking place on the refuge in October of 1937. Like September, October also
    produced some exceptionally fine weather. The peak of duck migration took place
    on October 20 with 200,000 ducks, most of which were mallards. Projects this month
    included food and cover planting, seed collection, cover mapping, the raising and
    grading of Highway 5, service building improvement and public relations efforts.
    The report concludes with a photographs section.",nt"license_title": "License
